    false,nt"url": null,nt"notes": "This annual narrative report for Tamarac
    National Wildlife Refuge summarizes Refuge activities during the 2001 fiscal year.
     The report begins with an introduction to the Refuge and a summary of the yearu2019s
    highlights and climatic conditions.  Information about monitoring and studies- including
    surveys and censuses- is provided next.  Habitat restoration and management projects
    are also covered; activities include wetland restoration, water level management,
    farming, timber management, fire management, and vegetation control.  Fish and wildlife
    management is discussed next with emphasis on bird banding and reintroductions.
     Coordination activities, such as private land activities, are outlined.  The resource
    protection section provides information about law enforcement and permits.  Information
    about public education and recreation is given including visitor services.  Finally,
    Refuge planning and administration- including Comprehensive Conservation Planning
    and general administration- are discussed; Refuge brochures are attached.",nt"license_title":
